const initialState = {
    expenses: []
  };
  export const expenseReducer = (state = initialState, action) => {
    switch (action.type) {
      case 'UPDATE_EXPENSES':
        return {
          ...state,
          expenses: action.value.map((doc) => ({ ...doc.data(), ...{ id: doc.id } }))
        };
      default:
        return state;
    }
  };
